import React, { useState } from 'react';
import AppLayout from '../components/AppLayout';
import Slider from 'react-slick';
import styled from 'styled-components';

const images = [
  '/img/poster1.jpg',
  '/img/poster2.jpg',
  '/img/poster3.jpg',
  '/img/poster4.jpg',
  '/img/poster5.jpg',
];

const Mydiv = styled.div`
  width: 50%;
  margin: 10rem auto;
  height: 570px;
`;

const NextArrow = { onclick };

const Home = () => {
  const settings = {
    isfinite: true,
    lazyLoad: true,
    speed: 300,
    sliderToShow: 3,
    centerMode: true,
    centerPadding: 0,
  };
  return (
    <>
      <Mydiv>
        <Slider>
          {images.map((img, idx) => (
            <div>
              <img src={img} alt={img} />
            </div>
          ))}
        </Slider>
      </Mydiv>
    </>
  );
};

export default Home;
